import React, { useState } from 'react';
import './Header.css'; // Import the corresponding CSS file

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const handleSignOut = () => {
    localStorage.removeItem('token'); // Remove token from localStorage
    window.location.href = '/signin'; // Redirect to SignIn page after signout
  };

  return (
    <header className="header">
      <div className="hamburger-menu" onClick={toggleMenu}>
        â˜°
      </div>
      <div className="logo">Google Forms Clone</div>

      {isMenuOpen && (
        <div className="dropdown-menu">
          <div className="user-profile">
            <img src="/path-to-profile-pic.jpg" alt="User Profile" />
            <span>John Doe</span>
          </div>
          <ul>
            <li>Profile</li>
            <li>Settings</li>
            <li onClick={handleSignOut}>Sign Out</li>
          </ul>
        </div>
      )}
    </header>
  );
};

export default Header;
